CREATE DEFINER = 'root'@'localhost'
PROCEDURE proc_report_getGeneralInfor (IN schoolYear smallint, OUT teachers smallint, OUT students int, OUT classes smallint)
BEGIN
  SET teachers = (SELECT
      COUNT(*)
    FROM teachers t);
  SET classes = (SELECT
      COUNT(*)
    FROM classes c
    WHERE schoolYear BETWEEN c.schoolYear AND c.schoolYear + 2);
  SET students = (SELECT
      COUNT(*)
    FROM students s
      LEFT JOIN classes c
        ON s.classId = c.classId
    WHERE schoolYear BETWEEN c.schoolYear AND c.schoolYear + 2);
END
