--
-- Create procedure `proc_report_yearClassificationScoreCondition`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE proc_report_yearClassificationScoreCondition (IN year int)
BEGIN
  SELECT
    vsa.studentId,
    vsa.classId,
    vsa.subjectId,
    vsa.semester,
    vsa.year,
    AVG(vsa.average) AS average,
    c.classId,
    c.name,
    c.schoolYear
  FROM view_score_average vsa
    LEFT JOIN classes c
      ON vsa.classId = c.classId
  WHERE (year - c.schoolYear + 1 BETWEEN 1 AND 3)
  AND vsa.year = year - c.schoolYear + 1

  AND vsa.subjectId = "s01"
  GROUP BY vsa.studentId,
           c.schoolYear,
           year

  ;
END
$$

--
-- Create procedure `proc_report_semesterClassificationScoreCondition`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE proc_report_semesterClassificationScoreCondition (IN year int, IN semester smallint)
BEGIN
  SELECT
    *
  FROM view_score_average vsa
    LEFT JOIN classes c
      ON vsa.classId = c.classId
  WHERE (year - c.schoolYear + 1 BETWEEN 1 AND 3)
  AND vsa.year = year - c.schoolYear + 1
  AND vsa.semester = semester
  AND vsa.subjectId = "s12"
  ;
END
