--
-- Create procedure `proc_score_year`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE proc_score_year (IN classId char(36), IN year smallint, IN q varchar(255))
BEGIN
  SET @q = LOWER(q);
  SELECT
    vs.classId,
    vs.studentId,
    vs.studentCode,
    vs.lastName,
    vs.fullName,
    vs.firstName,
    vs.subjectId,
    vs.subjectName,
    vs.year,
    AVG(vs.average) AS yearAverage
  FROM view_score vs
  WHERE vs.classId = classId
  AND vs.year = year
  AND LOWER(vs.fullName) LIKE CONCAT('%', @q, '%')
  GROUP BY vs.studentId,
           vs.subjectId
  ORDER BY firstName DESC;
END
$$

--
-- Create procedure `proc_score_getBySubject`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE proc_score_getBySubject (IN `classId` char(36), IN `subjectId` char(3), IN `semester` smallint, IN `year` smallint, IN `teacherId` char(36))
BEGIN
  SELECT
    vs.classId,
    vs.studentId,
    vs.studentCode,
    vs.lastName,
    vs.fullName,
    vs.firstName,
    vs.subjectId,
    vs.subjectName,
    vs.semester,
    vs.oralTest,
    vs.fifTest1,
    vs.fifTest2,
    vs.periodTest1,
    vs.periodTest2,
    vs.finalTest,
    vs.year,
    vs.average,
    t.classId,
    t.teacherId,
    t.semester,
    t.year,
    t.subjectId,
    t1.teacherId,

    t1.subjectId,
    t1.teacherCode,
    c.classId,
    c.name,
    c.schoolYear
  FROM view_score vs
    INNER JOIN teacherclasses t
      ON vs.classId = t.classId
      AND vs.semester = t.semester
      AND vs.year = t.year
    INNER JOIN teachers t1
      ON t.teacherId = t1.teacherId
      AND vs.subjectId = t1.subjectId
    INNER JOIN classes c
      ON t.classId = c.classId
  WHERE t.teacherId = teacherId
  AND t.semester = semester
  AND t.year = year - c.schoolYear + 1
  AND c.classId = classId
  ;
END
$$

